import emailIcon from "./images/email-icon.png";
import facebookIcon from "./images/facebook-icon.png";
import githubIcon from "./images/github-icon.png";
import iagoPhoto from "./images/iago-photo.jpg";
import instagramIcon from "./images/instagram-icon.png";
import linkedinIcon from "./images/linkedin-icon.png";
import twiterIcon from "./images/twiter-icon.png";

function Card() {
    return(
        <main>
            <img src={iagoPhoto} alt="" height="317px"/>

            <div>
                <h1>Iago Rocha</h1>
                <h2>Frontend student</h2>
                <h3>iagorrr.website</h3>
            </div>

            <div>
                <img src={emailIcon} alt="email-icon"/>
                <span>Email</span>
            </div>

            <div>
                <h2>About</h2>
                <p>
                    Lorem ipsum dolor sit amet, consectetur adipisicing elit. Delectus autem beatae tempore recusandae sint asperiores ipsum aliquam, quibusdam doloribus reiciendis quod ab. Veniam culpa nobis sunt doloribus consequuntur, temporibus adipisci.
                </p>

